import React from "react";
import ContainedButtons from "./Button";
import CustomizedInputs from "./Input";
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";

const useStyles = makeStyles(() => ({
  input: {
    margin: "10px auto",
    paddingTop: "200px",
    paddingLeft: "100px",
  },
  button: {
    margin: "10px auto",
    paddingTop: "100px",
    paddingLeft: "100px",
  },
}));

function Form() {
  const classes = useStyles();

  return (
    <>
      <Grid container>
        <Grid container item xs={12} spacing={3} className={classes.input}>
          <CustomizedInputs></CustomizedInputs>
        </Grid>
        <Grid container item xs={12} spacing={3} className={classes.button}>
          <ContainedButtons></ContainedButtons>
        </Grid>
      </Grid>
    </>
  );
}

export default Form;
